/**
 * @param {number[]} nums
 * @param {number} k
 * @return {number}
 */
var findKthLargest = function(nums, k) {
    // 写个快排 然后去取第k个数据
    function quickSort(list) {
        // 递归终止条件
        if (list.length <= 1) {
            return list
        }
        let l = [], r = [];
        let pivort = list[0]
        for (var i = 1; i < list.length; i++) {
            if (list[i] < pivort) {
                r.push(list[i])
            }
            else {
                l.push(list[i])
            }
        }

        return quickSort(l).concat(pivort).concat(quickSort(r))
    }

    nums = quickSort(nums)

    return nums[k - 1]
};

